vi arr(20, 0);

void precompute()
{
    // 1 -> 9
    // 2 -> 9
    // 3 -> (1 - 9) x (1 - 9) == 90
    // 4 -> (1 - 9) xx (1 - 9) == 900
    // where x = (0 - 9)
    arr[1] = arr[2] = 9;
    for (int i = 3; i <= 18; i++)
    {
        arr[i] = 9 * binpow(10, i - 2, (int)LLONG_MAX);
    }
    for (int i = 1; i <= 18; i++)
    {
        arr[i] += arr[i - 1];
    }
    debug(arr);
}

int len(int n)
{
    int x = 0;
    while (n)
    {
        x++;
        n /= 10;
    }
    return x;
}

int firstDigit(int n)
{
    return (n / binpow(10, len(n) - 1, (int)LLONG_MAX));
}

int untilThatPoint(int n)
{
    if (n < 10)
        return n;
    if(len(n) == 2)
    {
        int x = 9;
        for(int i = 11; i <= n; i++)
        {
            x += firstDigit(i) == (i % 10);
        }
        return x;
    }

    // 3456
    // 3 .. 3

    // 3 x (82)
    // dbg(len(1024));
    int ans = arr[len(n) - 1];
    ans += (firstDigit(n) - 1) * binpow(10, len(n) - 2, (int)LLONG_MAX);
    string s = "";
    int aux = n;
    map<int, char> mp;
    char ch = '0';
    for (int i = 0; i < 10; i++)
    {
        mp[i] = ch++;
    }
    while (aux)
    {
        s += mp[aux % 10];
        aux /= 10;
    }
    s.pop_back();
    reverse(all(s));
    s.pop_back();
    reverse(all(s));

    int num = 0;
    for (int i = 0; i < s.length(); i++)
    {
        num += (s[i] - '0') * binpow(10, i, (int)LLONG_MAX);
    }
    dbg(s);
    if (firstDigit(n) <= n % 10)
        return ans + num + 1;
    return ans + num;
}

