class Solution {

    public static void main(String args[]) {
        Scanner in = new Scanner(System.in);
        
        // Lecture du type (impair ou pair) et de la valeur maximale
        String type = in.next();
        int value = in.nextInt();
        
        // Initialisation de la variable x en fonction du type
